import React, {Component} from 'react';

import './Moi.css';

class Moi extends Component {

  typeWriter(s, index, vitesse) {
    let min = Math.ceil(500);
    let max = Math.floor(1500);
    vitesse = Math.floor(Math.random() * (max - min)) + min;
    if (index < s.length) {
      //document.querySelector('.type-writer').innerHTML += '|';
      //document.querySelector('.type-writer').innerHTML += '|';
      document.querySelector('.type-writer').innerHTML += s.charAt(index);
      index++;
      setTimeout(() => {
        this.typeWriter(s, index, vitesse);
      }, vitesse);
    }
  }

  componentDidMount() {
    this.typeWriter("Mon profil", 0, 500);
  }

  render() {
    return (<div id="moi">
      <h1 className="type-writer title"></h1>
    </div>);
  }
}

export default Moi;
